import React from "react";
import clsx from "clsx";
import styles from "../Mainpage/Mainpage.module.scss";
import Wallcat from "../../asset/wallcat3.png";
import { Outlet } from "react-router-dom";

const Mainpage = () => {
  return (
    <div className={styles.mainpage}>
      <div className={clsx(styles.intro_box)}>
        <p className={styles.p1}>Welcome to 婐ㄉ酷酷筆記本</p>
        <p className={styles.p2}>泥可以在這裡得到......</p>
        <p className={styles.p2}>React相關知識、套件、Git相關知識</p>
        <p className={styles.p2}>喜歡的話還可以寄信給我 ⌓‿⌓</p>
        <form>
          <div className={styles.mailbox,styles.mailbox2}>
            <img
              className={(styles.wallcat,styles.wallcat2)}
              src={Wallcat}
              alt="wallcat"
            ></img>
            <div className={styles.square}>
              <label className={styles.mailname}>姓名:</label>
              <input className={styles.mailname_input}></input>
              <label className={styles.mailmail}>聯絡信箱:</label>
              <input className={styles.mailmail_input}></input>
              <label className={styles.mailquestion}>有什麼問題?</label>
              <textarea className={styles.mailquestion_input}></textarea>
              <button className={styles.mailbutton}>送出</button>
            </div>
          </div>
        </form>
        <Outlet />
      </div>
    </div>
  );
};

export default Mainpage;
